<!DOCTYPE html>
<html lang="it">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Turisti vs Escursionisti - Lombardia - Con Tooltip</title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Titillium+Web:wght@300;400;600;700&display=swap" rel="stylesheet">
    <script src="https://d3js.org/d3.v7.min.js"></script>
    <style>
        body {
            margin: 0;
            padding: 0;
            background: #f5f5f5;
            font-family: 'Titillium Web', sans-serif;
            overflow: hidden;
        }
        
        #container {
            width: 100vw;
            height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
        }
        
        svg {
            background: #f5f5f5;
        }
        
        .zone {
            stroke-width: 0.3;
            stroke-linejoin: round;
            transition: all 0.2s;
            cursor: pointer;
        }
        
        .zone:hover {
            stroke: rgba(255, 255, 255, 0.9);
            stroke-width: 2;
        }
        
        .wave-circle {
            fill: none;
            stroke: rgba(255, 255, 255, 0.6);
            stroke-width: 3;
            opacity: 0;
        }
        
        .tooltip {
            position: absolute;
            pointer-events: none;
            background: rgba(15, 15, 15, 0.95);
            border: 1px solid rgba(255, 255, 255, 0.3);
            border-radius: 12px;
            padding: 16px;
            color: white;
            font-size: 13px;
            opacity: 0;
            transition: opacity 0.2s;
            box-shadow: 0 4px 20px rgba(0, 0, 0, 0.5);
            max-width: 350px;
            z-index: 1000;
        }
        
        .tooltip.visible {
            opacity: 1;
        }
        
        .tooltip-header {
            font-size: 16px;
            font-weight: bold;
            margin-bottom: 12px;
            padding-bottom: 8px;
            border-bottom: 1px solid rgba(255, 255, 255, 0.2);
        }
        
        .tooltip-section {
            margin: 10px 0;
        }
        
        .tooltip-label {
            font-size: 11px;
            color: rgba(255, 255, 255, 0.6);
            text-transform: uppercase;
            letter-spacing: 0.5px;
            margin-bottom: 4px;
        }
        
        .comuni-list {
            font-size: 11px;
            color: rgba(255, 255, 255, 0.7);
            line-height: 1.4;
            max-height: 100px;
            overflow-y: auto;
            padding-left: 8px;
        }
        
        .comuni-list::-webkit-scrollbar {
            width: 4px;
        }
        
        .comuni-list::-webkit-scrollbar-track {
            background: rgba(255, 255, 255, 0.1);
        }
        
        .comuni-list::-webkit-scrollbar-thumb {
            background: rgba(255, 255, 255, 0.3);
            border-radius: 2px;
        }
        
        .data-grid {
            display: grid;
            grid-template-columns: auto 1fr auto;
            gap: 6px 12px;
            align-items: center;
            margin-top: 8px;
        }
        
        .data-label {
            font-size: 12px;
            font-weight: 500;
        }
        
        .data-bar {
            height: 8px;
            background: rgba(255, 255, 255, 0.1);
            border-radius: 4px;
            overflow: hidden;
        }
        
        .data-bar-fill {
            height: 100%;
            border-radius: 4px;
        }
        
        .data-value {
            font-size: 12px;
            font-weight: bold;
            text-align: right;
        }
        
        .legend {
            position: absolute;
            top: 30px;
            right: 30px;
            background: transparent;
            padding: 20px;
            border-radius: 10px;
            border: 2px solid rgba(41, 122, 56, 1);
            color: #000000;
            font-size: 13px;
        }
        
        .legend-title {
            font-size: 15px;
            font-weight: bold;
            margin-bottom: 15px;
            text-align: center;
        }
        
        .legend-gradient {
            width: 200px;
            height: 20px;
            margin: 10px 0;
            border-radius: 3px;
            border: 1px solid rgba(255, 255, 255, 0.3);
        }
        
        .title {
            position: absolute;
            top: 30px;
            left: 30px;
            color: white;
            font-size: 24px;
            font-weight: bold;
            text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.8);
        }
        
        .season-indicator {
            position: absolute;
            top: 70px;
            left: 30px;
            color: rgba(255, 255, 255, 0.9);
            font-size: 18px;
            font-weight: 500;
            text-shadow: 1px 1px 2px rgba(0, 0, 0, 0.8);
            padding: 8px 16px;
            background: rgba(41, 122, 56, 0.8);
            border-radius: 8px;
            border: 1px solid rgba(41, 122, 56, 1);
            transition: all 0.3s;
        }
        
        .season-indicator.flash {
            background: rgba(41, 122, 56, 0.2);
            transform: scale(1.15);
            color: white;
        }
        
        .controls {
            position: absolute;
            bottom: 0px;
            left: 50%;
            transform: translateX(-50%);
            background: rgba(255, 255, 255, 0.8);
            padding: 20px 40px;
            border-radius: 12px;
            border: 1px solid rgba(41, 122, 56, 0.8);
            display: flex;
            align-items: center;
            gap: 20px;
            min-width: 600px;
        }
        
        .play-button {
            background: rgba(41, 122, 56, 0.8);
            border: none;
            color: white;
            width: 50px;
            height: 50px;
            border-radius: 50%;
            cursor: pointer;
            font-size: 20px;
            display: flex;
            align-items: center;
            justify-content: center;
            transition: all 0.3s;
        }
        
        .play-button:hover {
            background: rgba(41, 122, 56, 1);
            transform: scale(1.1);
        }
        
        .slider-container {
            flex: 1;
            display: flex;
            flex-direction: column;
            gap: 8px;
        }
        
        .slider {
            width: 100%;
            height: 6px;
            border-radius: 3px;
            background: rgba(88, 93, 91, 0.4);
            outline: none;
            -webkit-appearance: none;
        }
        
        .slider::-webkit-slider-thumb {
            -webkit-appearance: none;
            appearance: none;
            width: 20px;
            height: 20px;
            border-radius: 50%;
            background: linear-gradient(135deg, #FF1493, #00CED1);
            cursor: pointer;
            border: 2px solid white;
        }
        
        .slider::-moz-range-thumb {
            width: 20px;
            height: 20px;
            border-radius: 50%;
            background: linear-gradient(135deg, #FF1493, #00CED1);
            cursor: pointer;
            border: 2px solid white;
        }
        
        .season-labels {
            position: relative;
            display: flex;
            justify-content: space-between;
            color: #000000;
            font-size: 11px;
            font-weight: bold;
            margin-top: 8px;
            height: 30px;
        }
        
        .season-label {
            position: absolute;
            text-align: center;
            transform: translateX(-50%);
            white-space: nowrap;
        }
        
        .season-label:nth-child(1) { left: 0%; }
        .season-label:nth-child(2) { left: 20%; }
        .season-label:nth-child(3) { left: 40%; }
        .season-label:nth-child(4) { left: 60%; }
        .season-label:nth-child(5) { left: 80%; }
        .season-label:nth-child(6) { left: 100%; }
    </style>
</head>

isti":13.67,"escursionisti":28.5,"abituali":8.5,"locali":49.33},{"provincia":"MB","zona":"Nord Ovest","turisti":15.43,"escursionisti":32.14,"abituali":8.29,"locali":44.14},{"provincia":"MB","zona":"Sud Ovest","turisti":15.5,"escursionisti":33.25,"abituali":7.25,"locali":44.0},{"provincia":"MB","zona":"Sud","turisti":16.5,"escursionisti":31.75,"abituali":8.5,"locali":43.25},{"provincia":"MB","zona":"Ovest","turisti":17.67,"escursionisti":33.17,"abituali":8.5,"locali":40.67},{"provincia":"MB","zona":"Nord Est","turisti":16.0,"escursionisti":28.0,"abituali":9.5,"locali":46.5}]};
const stagioniOrder = ["Inverno 2024", "Primavera 2024", "Estate 2024", "Autunno 2024", "Inverno 2025", "Primavera 2025"];


        // Configurazione
        const width = 1280;
        const height = 1024;
        
        const svg = d3.select("#map")
            .attr("width", width)
            .attr("height", height);

        const zonesGroup = svg.append("g");
        const waveGroup = svg.append("g");

        // Normalizzazione nomi province
        const provinceMap = {
            'VA': 'Varese', 'CO': 'Como', 'SO': 'Sondrio',
            'MI': 'Milano', 'BG': 'Bergamo', 'BS': 'Brescia',
            'PV': 'Pavia', 'CR': 'Cremona', 'MN': 'Mantova',
            'LC': 'Lecco', 'LO': 'Lodi', 'MB': 'Monza e della Brianza'
        };

        // Dati per tutte le stagioni 
        const seasonDataMaps = {};
        Object.keys(stagioniData).forEach(season => {
            const dataMap = new Map();
            stagioniData[season].forEach(d => {
                const provincia = provinceMap[d.provincia];
                const key = `${provincia}_${d.zona}`;
                dataMap.set(key, {
                    turisti: d.turisti,
                    escursionisti: d.escursionisti,
                    abituali: d.abituali,
                    locali: d.locali
                });
            });
            seasonDataMaps[season] = dataMap;
        });

        // range globale
        let allRatios = [];
        let allGaps = [];
        Object.values(seasonDataMaps).forEach(dataMap => {
            dataMap.forEach(d => {
                const ratio = d.turisti / (d.turisti + d.escursionisti);
                const gap = Math.abs(d.escursionisti - d.turisti);
                allRatios.push(ratio);
                allGaps.push(gap);
            });
        });
        
        const minRatio = d3.min(allRatios);
        const maxRatio = d3.max(allRatios);
        const maxGap = d3.max(allGaps);

        // Funzione per calcolare il colore
        function getColor(turisti, escursionisti) {
            const total = turisti + escursionisti;
            const ratio = turisti / total;
            const gap = Math.abs(escursionisti - turisti);
            
            const normalizedRatio = (ratio - minRatio) / (maxRatio - minRatio);
            const intensity = 1 - (gap / maxGap);
            
            const pink = d3.rgb(255, 20, 147);
            const cyan = d3.rgb(0, 206, 209);
            const color = d3.interpolateRgb(pink, cyan)(normalizedRatio);
            const finalColor = d3.rgb(color);
            const brightness = 0.3 + (intensity * 0.7);
            
            return d3.rgb(
                finalColor.r * brightness,
                finalColor.g * brightness,
                finalColor.b * brightness
            ).toString();
        }

        // Colori per le categorie
        const categoryColors = {
            'Turisti': '#00CED1',
            'Escursionisti': '#FF1493',
            'Abituali': '#FFD700',
            'Locali': '#9370DB'
        };

        // Gradiente legenda
        d3.select("#gradient")
            .style("background", "linear-gradient(to right, rgb(255, 20, 147), rgb(0, 206, 209))");

        // Proiezione
        const geojson = geojsonData;
        const projection = d3.geoMercator()
            .fitSize([width * 0.8, height * 0.8], geojson);
        const path = d3.geoPath().projection(projection);

        // Calcolo centroide della Lombardia
        const bounds = d3.geoBounds(geojson);
        const centerLon = (bounds[0][0] + bounds[1][0]) / 2;
        const centerLat = (bounds[0][1] + bounds[1][1]) / 2;
        const lombardyCenter = projection([centerLon, centerLat]);
        const mapCenterX = lombardyCenter[0] + width * 0.1;
        const mapCenterY = lombardyCenter[1] + height * 0.1;

        // Calcola distanza di ogni zona dal centro
        const zoneDistances = new Map();
        let maxDistance = 0;
        geojson.features.forEach(feature => {
            const centroid = d3.geoCentroid(feature);
            const projected = projection(centroid);
            const distance = Math.sqrt(
                Math.pow(projected[0] - lombardyCenter[0], 2) + 
                Math.pow(projected[1] - lombardyCenter[1], 2)
            );
            const key = `${feature.properties.provincia}_${feature.properties.zona}`;
            zoneDistances.set(key, distance);
            maxDistance = Math.max(maxDistance, distance);
        });

        // Disegno le zone
        const zones = zonesGroup.selectAll(".zone")
            .data(geojson.features)
            .enter()
            .append("path")
            .attr("class", "zone")
            .attr("d", path)
            .attr("transform", `translate(${width * 0.1}, ${height * 0.1})`);

        // Cerchio wave
        const waveCircle = waveGroup.append("circle")
            .attr("class", "wave-circle")
            .attr("cx", mapCenterX)
            .attr("cy", mapCenterY)
            .attr("r", 0);

        // Tooltip
        const tooltip = d3.select("#tooltip");

        // Tooltip handlers
        zones.on("mouseenter", function(event, d) {
            const provincia = d.properties.provincia;
            const zona = d.properties.zona;
            const comuni = d.properties.comuni || [];
            const key = `${provincia}_${zona}`;
            const seasonName = stagioniOrder[currentSeasonIndex];
            const zoneData = seasonDataMaps[seasonName].get(key);
            
            if (zoneData) {
                // HTML tooltip
                let html = `
                    <div class="tooltip-header">${provincia} - ${zona}</div>
                    
                    <div class="tooltip-section">
                        <div class="tooltip-label">Distribuzione Visitatori</div>
                        <div class="data-grid">
                `;
                
                const categories = [
                    { name: 'Turisti', value: zoneData.turisti, color: categoryColors['Turisti'] },
                    { name: 'Escursionisti', value: zoneData.escursionisti, color: categoryColors['Escursionisti'] },
                    { name: 'Abituali', value: zoneData.abituali, color: categoryColors['Abituali'] },
                    { name: 'Locali', value: zoneData.locali, color: categoryColors['Locali'] }
                ];
                
                categories.forEach(cat => {
                    html += `
                        <div class="data-label">${cat.name}</div>
                        <div class="data-bar">
                            <div class="data-bar-fill" style="width: ${cat.value}%; background: ${cat.color};"></div>
                        </div>
                        <div class="data-value" style="color: ${cat.color};">${cat.value.toFixed(1)}%</div>
                    `;
                });
                
                html += `
                        </div>
                    </div>
                `;
                
                tooltip.html(html);
                tooltip.classed("visible", true);
            }
        })
        .on("mousemove", function(event) {
            const [x, y] = d3.pointer(event, document.body);
            const tooltipNode = tooltip.node();
            const tooltipRect = tooltipNode.getBoundingClientRect();
            const tooltipWidth = tooltipRect.width || 350; // fallback alla larghezza massima
            const tooltipHeight = tooltipRect.height || 400; // fallback a una stima
            
            // Offset dal cursore
            const offsetX = 20;
            const offsetY = 20;
            
            // Posizione di default (destra e sopra il cursore)
            let leftPos = x + offsetX;
            let topPos = y - offsetY;
            
            // Controlla se esce a destra
            if (leftPos + tooltipWidth > 1280) {
                leftPos = x - tooltipWidth - offsetX;
            }
            
            // Controlla se esce in basso
            if (topPos + tooltipHeight > 1024) {
                topPos = 1024 - tooltipHeight - 10;
            }
            
            // Controlla se esce in alto
            if (topPos < 0) {
                topPos = 10;
            }
            
            // Controlla se esce a sinistra
            if (leftPos < 0) {
                leftPos = 10;
            }
            
            tooltip
                .style("left", leftPos + "px")
                .style("top", topPos + "px");
        })
        .on("mouseleave", function() {
            tooltip.classed("visible", false);
        });

        // Stato
        let currentSeasonIndex = 0;
        let isPlaying = false;
        let playInterval = null;
        let firstTimeout = null;

        // Funzione wave drammatico
        function updateVisualization(seasonIndex, animate = true) {
            currentSeasonIndex = seasonIndex;
            const seasonName = stagioniOrder[seasonIndex];
            const dataMap = seasonDataMaps[seasonName];
            
            const indicator = d3.select("#seasonIndicator");
            indicator.classed("flash", true);
            setTimeout(() => indicator.classed("flash", false), 300);
            indicator.text(seasonName);

            if (animate) {
                waveCircle
                    .attr("r", 0)
                    .attr("opacity", 0.8)
                    .transition()
                    .duration(1500)
                    .ease(d3.easeQuadOut)
                    .attr("r", maxDistance * 1.5)
                    .attr("opacity", 0);

                zones.each(function(d) {
                    const zona = d3.select(this);
                    const provincia = d.properties.provincia;
                    const zonaName = d.properties.zona;
                    const key = `${provincia}_${zonaName}`;
                    const zoneData = dataMap.get(key);
                    
                    if (zoneData) {
                        const newColor = getColor(zoneData.turisti, zoneData.escursionisti);
                        const distance = zoneDistances.get(key) || 0;
                        const normalizedDistance = distance / maxDistance;
                        const delay = normalizedDistance * 800;
                        
                        zona.transition()
                            .delay(delay)
                            .duration(100)
                            .attr("fill", "rgba(255, 255, 255, 0.8)")
                            .attr("stroke", "rgba(255, 255, 255, 0.8)")
                            .transition()
                            .duration(400)
                            .ease(d3.easeCubicOut)
                            .attr("fill", newColor)
                            .attr("stroke", newColor);
                    }
                });
            } else {
                zones.each(function(d) {
                    const zona = d3.select(this);
                    const provincia = d.properties.provincia;
                    const zonaName = d.properties.zona;
                    const key = `${provincia}_${zonaName}`;
                    const zoneData = dataMap.get(key);
                    
                    if (zoneData) {
                        const color = getColor(zoneData.turisti, zoneData.escursionisti);
                        zona.attr("fill", color).attr("stroke", color);
                    }
                });
            }
        }

        updateVisualization(0, false);

        const slider = d3.select("#timeSlider");
        slider.on("input", function() {
            const index = +this.value;
            if (isPlaying) {
                stopAnimation();
            }
            updateVisualization(index, true);
        });

        const playButton = d3.select("#playButton");
        
        function startAnimation() {
            isPlaying = true;
            playButton.text("⏸");
            
            // Prima transizione dopo 2 secondi
            firstTimeout = setTimeout(() => {
                currentSeasonIndex = (currentSeasonIndex + 1) % stagioniOrder.length;
                slider.property("value", currentSeasonIndex);
                updateVisualization(currentSeasonIndex, true);
                
                // Poi continua con intervalli di 3 secondi
                playInterval = setInterval(() => {
                    currentSeasonIndex = (currentSeasonIndex + 1) % stagioniOrder.length;
                    slider.property("value", currentSeasonIndex);
                    updateVisualization(currentSeasonIndex, true);
                }, 3000);
            }, 2000);
        }
        
        function stopAnimation() {
            isPlaying = false;
            playButton.text("▶");
            if (firstTimeout) {
                clearTimeout(firstTimeout);
                firstTimeout = null;
            }
            if (playInterval) {
                clearInterval(playInterval);
                playInterval = null;
            }
        }
        
        playButton.on("click", function() {
            if (isPlaying) {
                stopAnimation();
            } else {
                startAnimation();
            }
        });
    </script>
